Maintenant que nous avons une saisie utilisateur et un nombre aléatoire, nous pouvons les comparer. Cette étape est écrite dans l'encart 2-4. Sachez toutefois que le code ne se compile pas encore, nous allons l'expliquer par la suite. Fichier : src/main.rs use std::io;
use std::cmp::Ordering;
use rand::Rng; fn main() { // --- code inchangé masqué ici --- println!("Votre nombre : {}", supposition); match supposition.cmp(&nombre_secret) { Ordering::Less => println!("C'est plus !"), Ordering::Greater => println!("C'est moins !"), Ordering::Equal => println!("Vous avez gagné !"), }
} Encart 2-4 : Traitement des valeurs possibles saisies en comparant les deux nombres La première nouveauté ici est une nouvelle utilisation de l'instruction use, qui importe std::cmp::Ordering à portée de notre code depuis la bibliothèque standard. Comme Result, Ordering est une autre énumération, mais les variantes pour Ordering sont Less (inférieur) , Greater (supérieur) et Equal (égal) . Ce sont les trois issues possibles lorsqu'on compare deux valeurs. Ensuite, nous ajoutons cinq nouvelles lignes à la fin qui utilisent le type Ordering. La méthode cmp compare deux valeurs et peut être appelée sur tout ce qui peut être comparé. Elle prend en paramètre une référence de ce qu'on veut comparer : ici, nous voulons comparer supposition et nombre_secret. Ensuite, cela retourne une variante de l'énumération Ordering que nous avons importée avec l'instruction use. Nous utilisons une expression match pour décider quoi faire ensuite en fonction de quelle variante de Ordering a été retournée à l'appel de cmp avec supposition et nombre_secret. Une expression match est composée de branches . Une branche est constituée d'un motif (pattern) et du code qui sera exécuté si la valeur donnée au début de l'expression match correspond bien au motif de cette branche. Rust prend la valeur donnée à match et la compare au motif de chaque branche à tour de rôle. La structure de contrôle match et les motifs sont des fonctionnalités puissantes de Rust qui vous permettent de décrire une multitude de scénarios que votre code peut rencontrer et de s'assurer que vous les gérez toutes. Ces fonctionnalités seront expliquées plus en détail respectivement dans le chapitre 6 et le chapitre 18. Voyons un exemple de ce qui se passerait avec l'expression match utilisée ici. Disons que l'utilisateur a saisi le nombre 50 et que le nombre secret généré aléatoirement a cette fois-ci comme valeur 38. Quand le code compare 50 à 38, la méthode cmp va retourner Ordering::Greater, car 50 est plus grand que 38. L'expression match obtient la valeur Ordering::Greater et commence à vérifier le motif de chaque branche. Elle consulte le motif de la première branche, Ordering::Less et remarque que la valeur Ordering::Greater ne correspond pas au motif Ordering::Less ; elle ignore donc le code de cette branche et passe à la suivante. Le motif de la branche suivante, Ordering::Greater, correspond à Ordering::Greater ! Le code associé à cette branche va être exécuté et va afficher à l'écran C'est moins !. L'expression match se termine ensuite, car elle n'a pas besoin de consulter les autres branches de ce scénario. Cependant, notre code dans l'encart 2-4 ne compile pas encore. Essayons de le faire : $ cargo build Compiling guessing_game v0.1.0 (file:///projects/guessing_game)
error[E0308]: mismatched types -- > src/main.rs:23:21 |
23 | match supposition.cmp(&nombre_secret) { | ^^^^^^^^^^^^^^ expected struct `std::string::String`, found integral variable | = note: expected type `&std::string::String` = note: found type `&{integer}` error: aborting due to previous error
Could not compile `guessing_game`. Le message d'erreur nous indique que nous sommes dans un cas de types non compatibles (mismatched types) . Rust a un système de types fort et statique. Cependant, il a aussi une fonctionnalité d'inférence de type. Quand nous avons écrit let mut supposition = String::new(), Rust a pu en déduire que supposition devait être une String et ne nous a pas demandé d'écrire le type. D'autre part, nombre_secret est d'un type de nombre. Quelques types de nombres peuvent avoir une valeur entre 1 et 100 : i32, un nombre entier encodé sur 32 bits ; u32, un nombre entier de 32 bits non signé (positif ou nul) ; i64, un nombre entier encodé sur 64 bits ; parmi tant d'autres. Rust utilise par défaut un i32, qui est le type de nombre_secret, à moins que vous précisiez quelque part une information de type qui amènerait Rust à inférer un type de nombre différent. La raison de cette erreur est que Rust ne peut pas comparer une chaîne de caractères à un nombre. Au bout du compte, nous voulons convertir la String que le programme récupère de la saisie utilisateur en un nombre, pour qu'on puisse la comparer numériquement au nombre secret. Nous pouvons faire ceci en ajoutant les deux lignes suivantes dans le corps de la fonction main : Fichier : src/main.rs // -- code inchangé masqué ici -- let mut supposition = String::new(); io::stdin().read_line(&mut supposition) .expect("Échec de la lecture de l'entrée utilisateur"); let supposition: u32 = supposition.trim().parse() .expect("Veuillez entrer un nombre !"); println!("Votre nombre : {}", supposition); match supposition.cmp(&nombre_secret) { Ordering::Less => println!("C'est plus !"), Ordering::Greater => println!("C'est moins !"), Ordering::Equal => println!("Vous avez gagné !"), }
} Les deux nouvelles lignes sont : let supposition: u32 = supposition.trim().parse() .expect("Veuillez entrer un nombre !"); Nous créons une variable qui s'appelle supposition. Mais attendez, le programme n'a-t-il pas déjà une variable qui s'appelle supposition ? C'est le cas, mais Rust nous permet de masquer la valeur précédente de supposition avec une nouvelle. Cette fonctionnalité est souvent utilisée dans des situations où on veut convertir une valeur d'un type à un autre. Le masquage (shadowing) nous permet de réutiliser le nom de variable supposition, plutôt que de nous forcer à créer deux variables distinctes, telles que supposition_str et supposition par exemple. (Le chapitre 3 expliquera plus en détail le masquage.) Nous lions supposition à l'expression supposition.trim().parse(). Le supposition dans l'expression se réfère au supposition initial qui était une String contenant la saisie utilisateur. La méthode trim sur une instance de String va enlever les espaces et autres whitespaces au début et à la fin. Même si u32 ne peut contenir que des chiffres, l'utilisateur doit appuyer sur entrée pour mettre fin à read_line. Lorsque l'utilisateur appuie sur entrée, un caractère de fin de ligne est ajouté à la chaîne de caractères. Par exemple, si l'utilisateur écrit 5 et appuie sur entrée, supposition aura alors cette valeur : 5\n. Le \n représente une fin de ligne, qui résulte de l'appui sur entrée. La méthode trim enlève \n, il ne reste donc plus que 5. La méthode parse des chaînes de caractères interprète une chaîne de caractères en une sorte de nombre. Comme cette méthode peut interpréter plusieurs types de nombres, nous devons indiquer à Rust le type exact de nombre que nous voulons en utilisant let supposition: u32. Le deux-points (:) après supposition indique à Rust que nous voulons préciser le type de la variable. Rust embarque quelques types de nombres ; le u32 utilisé ici est un entier non signé sur 32 bits. C'est un bon choix par défaut pour un petit nombre positif. Vous découvrirez d'autres types de nombres dans le chapitre 3. De plus, l'annotation u32 dans ce programme d'exemple et la comparaison avec nombre_secret permet à Rust d'en déduire que nombre_secret doit être lui aussi un u32. Donc maintenant, la comparaison se fera entre deux valeurs du même type ! L'utilisation de parse peut facilement mener à une erreur. Si par exemple, le texte contient A👍%, il ne sera pas possible de le convertir en nombre. Comme elle peut échouer, la méthode parse retourne un type Result, comme celui que la méthode read_line retourne (comme nous l'avons vu plus tôt dans “Gérer les erreurs potentielles avec le type Result” ). Nous allons gérer ce Result de la même manière, avec à nouveau la méthode expect. Si parse retourne une variante Err de Result car elle ne peut pas créer un nombre à partir de la chaîne de caractères, l'appel à expect va faire planter le jeu et va afficher le message que nous lui avons passé en paramètre. Si parse arrive à convertir la chaîne de caractères en nombre, alors elle retournera la variante Ok de Result, et expect va retourner le nombre qu'il nous faut qui est stocké dans la variante Ok. Exécutons ce programme, maintenant ! $ cargo run Compiling guessing_game v0.1.0 (file:///projects/guessing_game) Finished dev [unoptimized + debuginfo] target(s) in 0.43 secs Running `target/debug/guessing_game`
Devinez le nombre !
Le nombre secret est : 58
Veuillez entrer un nombre. 76
Votre nombre : 76
C'est moins ! Très bien ! Même si des espaces ont été ajoutées avant la supposition, le programme a quand même compris que l'utilisateur a saisi 76. Lancez le programme plusieurs fois pour vérifier qu'il se comporte correctement avec différentes saisies : devinez le nombre correctement, saisissez un nombre qui est trop grand, et saisissez un nombre qui est trop petit. La majeure partie du jeu fonctionne désormais, mais l'utilisateur ne peut faire qu'une seule supposition. Corrigeons cela en ajoutant une boucle !

