Tel qu'abordé au chapitre 2, par défaut, les variables sont immuables . C'est un des nombreux coups de pouce de Rust pour écrire votre code de façon à garantir la sécurité et la concurrence sans problème. Cependant, vous avez quand même la possibilité de rendre vos variables mutables (modifiables) . Explorons comment et pourquoi Rust vous encourage à favoriser l'immuabilité, et pourquoi parfois vous pourriez choisir d'y renoncer. Lorsqu'une variable est immuable, cela signifie qu'une fois qu'une valeur est liée à un nom, vous ne pouvez pas changer cette valeur. À titre d'illustration, générons un nouveau projet appelé variables dans votre dossier projects en utilisant cargo new variables. Ensuite, dans votre nouveau dossier variables , ouvrez src/main.rs et remplacez son code par le code suivant qui ne compile pas pour le moment : Fichier : src/main.rs fn main() { let x = 5; println!("La valeur de x est : {}", x); x = 6; println!("La valeur de x est : {}", x);
} Sauvegardez et lancez le programme en utilisant cargo run. Vous devriez avoir un message d'erreur comme celui-ci : error[E0384]: cannot assign twice to immutable variable `x` --> src/main.rs:4:5 |
2 | let x = 5; | - first assignment to `x`
3 | println!("La valeur de x est : {}", x);
4 | x = 6; | ^^^^^ cannot assign twice to immutable variable Cet exemple montre comment le compilateur vous aide à trouver les erreurs dans vos programmes. Même si les erreurs de compilation peuvent s'avérer frustrantes, elles signifient uniquement que, pour le moment, votre programme n'est pas en train de faire ce que vous voulez qu'il fasse en toute sécurité ; elles ne signifient pas que vous êtes un mauvais développeur ! Même les Rustacés expérimentés continuent d'avoir des erreurs de compilation. Ce message d'erreur indique que la cause du problème est qu'il est impossible d'assigner à deux reprises la variable immuable x (cannot assign twice to immutable variable x). Il est important que nous obtenions des erreurs au moment de la compilation lorsque nous essayons de changer une valeur qui a précédemment été déclarée comme immuable, car cette situation particulière peut donner lieu à des bogues. Si une partie de notre code part du principe qu'une valeur ne changera jamais et qu'une autre partie de notre code modifie cette valeur, il est possible que la première partie du code ne fasse pas ce pour quoi elle a été conçue. La cause de ce genre de bogue peut être difficile à localiser après coup, en particulier lorsque la seconde partie du code ne modifie que parfois cette valeur. Avec Rust, le compilateur garantit que lorsque nous déclarons qu'une variable ne changera pas, elle ne changera vraiment pas. Cela signifie que lorsque vous lisez et écrivez du code, vous n'avez pas à vous soucier d'où et comment la valeur pourrait changer. Votre code est ainsi plus facile à comprendre. Mais la mutabilité peut s'avérer très utile. Les variables sont immuables par défaut ; mais comme vous l'avez fait au chapitre 2, vous pouvez les rendre mutables en ajoutant mut devant le nom de la variable. En plus de permettre à cette valeur de changer, mut va signaler l'intention aux futurs lecteurs de ce code que d'autres parties du code vont modifier la valeur de cette variable. Par exemple, modifions src/main.rs ainsi : Fichier : src/main.rs fn main() { let mut x = 5; println!("La valeur de x est : {}", x); x = 6; println!("La valeur de x est : {}", x);
} Lorsque nous exécutons le programme, nous obtenons : $ cargo run Compiling variables v0.1.0 (file:///projects/variables) Finished dev [unoptimized + debuginfo] target(s) in 0.30 secs Running `target/debug/variables`
La valeur de x est : 5
La valeur de x est : 6 En utilisant mut, nous avons permis à la valeur de x de passer de 5 à 6. Dans certains cas, on voudra rendre une variable mutable car cela rendra le code plus pratique à écrire que s'il n'utilisait que des variables immuables. Il y a d'autres compromis à envisager, en plus de la prévention des bogues. Par exemple, dans le cas où vous utiliseriez des grosses structures de données, muter une instance déjà existante peut être plus rapide que copier et retourner une instance nouvellement allouée. Avec des structures de données plus petites, créer de nouvelles instances avec un style de programmation fonctionnelle peut rendre le code plus facile à comprendre, donc il peut valoir le coup de sacrifier un peu de performance pour que le code gagne en clarté.

