Un type scalaire représente une seule valeur. Rust possède quatre types principaux de scalaires : les entiers, les nombres à virgule flottante, les booléens et les caractères. Vous les connaissez sûrement d'autres langages de programmation. Regardons comment ils fonctionnent avec Rust. Types de nombres entiers Un entier est un nombre sans partie décimale. Nous avons utilisé un entier précédemment dans le chapitre 2, le type u32. Cette déclaration de type indique que la valeur à laquelle elle est associée doit être un entier non signé encodé sur 32 bits dans la mémoire (les entiers pouvant prendre des valeurs négatives commencent par un i (comme integer : “entier”), plutôt que par un u comme unsigned : “non signé”). Le tableau 3-1 montre les types d'entiers intégrés au langage. Chaque variante dans les colonnes “Signé” et “Non signé” (par exemple i16) peut être utilisée pour déclarer le type d'une valeur entière. Tableau 3-1 : les types d'entiers en Rust Taille Signé Non signé 8 bits i8 u8 16 bits i16 u16 32 bits i32 u32 64 bits i64 u64 128 bits i128 u128 archi isize usize Chaque variante peut-être signée ou non signée et possède une taille explicite. Signé et non signé veut dire respectivement que le nombre peut prendre ou non des valeurs négatives ou positives — en d'autres termes, si l'on peut lui attribuer un signe (signé) ou s'il sera toujours positif et que l'on peut donc le représenter sans signe (non signé). C'est comme écrire des nombres sur du papier : quand le signe est important, le nombre est écrit avec un signe plus ou un signe moins ; en revanche, quand le nombre est forcément positif, on peut l'écrire sans son signe. Les nombres signés sont stockés en utilisant le complément à deux . Chaque variante signée peut stocker des nombres allant de −(2 n − 1) à 2 n − 1 − 1 inclus, où n est le nombre de bits que cette variante utilise. Un i8 peut donc stocker des nombres allant de −(27) à 27 − 1, c'est-à-dire de −128 à 127. Les variantes non signées peuvent stocker des nombres de 0 à 2 n − 1, donc un u8 peut stocker des nombres allant de 0 à 28 − 1, c'est-à-dire de 0 à 255. De plus, les types isize et usize dépendent du type d'ordinateur sur lequel votre programme va s'exécuter : 64 bits si vous utilisez une architecture 64 bits ou 32 bits si vous utilisez une architecture 32 bits. Vous pouvez écrire des littéraux d'entiers dans chacune des formes décrites dans le tableau 3-2. Notez que chaque littéral numérique excepté l'octet accepte un suffixe de type, comme 57u8, et _ comme séparateur visuel, comme par exemple 1_000. Tableau 3-2 : Les littéraux d'entiers en Rust Littéral numérique Exemple Décimal 98_222 Hexadécimal 0xff Octal 0o77 Binaire 0b1111_0000 Octet (u8 seulement) b'A' Comment pouvez-vous déterminer le type d'entier à utiliser ? Si vous n'êtes pas sûr, les choix par défaut de Rust sont généralement de bons choix, et le type d'entier par défaut est le i32 : c'est souvent le plus rapide, même sur les systèmes 64 bits. La principale utilisation d'un isize ou d'un usize est lorsque l'on indexe une quelconque collection. Dépassement d'entier Imaginons que vous avez une variable de type u8 qui peut stocker des valeurs entre 0 et 255. Si vous essayez de changer la variable pour une valeur en dehors de cet intervalle, comme 256, vous aurez un dépassement d'entier (integer overflow) . Rust possède quelques règles intéressantes concernant ce comportement. Quand vous compilez en mode débogage, Rust embarque des vérifications pour détecter les cas de dépassements d'entiers qui pourraient faire paniquer votre programme à l'exécution si ce phénomène se produit. Rust utilise le terme paniquer quand un programme se termine avec une erreur ; nous verrons plus en détail les paniques dans une section du chapitre 9 . Lorsque vous compilez en mode publication (release) avec le drapeau --release, Rust ne va pas vérifier les potentiels dépassements d'entiers qui peuvent faire paniquer le programme. En revanche, en cas de dépassement, Rust va effectuer un rebouclage du complément à deux . Pour faire simple, les valeurs supérieures à la valeur maximale du type seront “rebouclées” depuis la valeur minimale que le type peut stocker. Dans cas d'un u8, 256 devient 0, 257 devient 1, et ainsi de suite. Le programme ne va paniquer, mais la variable va avoir une valeur qui n'est probablement pas ce que vous attendez à avoir. Se fier au comportement du rebouclage lors du dépassement d'entier est considéré comme une faute. Si vous voulez reboucler explicitement, vous pouvez utiliser le type Wrapping de la bibliothèque standard. Types de nombres à virgule flottante Rust possède également deux types primitifs pour les nombres à virgule flottante (ou flottants ), qui sont des nombres avec des décimales. Les types de flottants en Rust sont les f32 et les f64, qui ont respectivement une taille en mémoire de 32 bits et 64 bits. Le type par défaut est le f64 car sur les processeurs récents ce type est quasiment aussi rapide qu'un f32 mais est plus précis. Voici un exemple montrant l'utilisation de nombres à virgule flottante : Nom du ficher: src/main.rs fn main() { let x = 2.0; // f64 let y: f32 = 3.0; // f32
} Les nombres à virgule flottante sont représentés selon la norme IEEE-754. Le type f32 est un flottant à simple précision, et le f64 est à double précision. Les opérations numériques Rust offre les opérations mathématiques de base dont vous auriez besoin pour tous les types de nombres : addition, soustraction, multiplication, division et modulo. Le code suivant montre comment utiliser chacune d'elles avec une instruction let : Fichier : src/main.rs fn main() { // addition let somme = 5 + 10; // soustraction let difference = 95.5 - 4.3; // multiplication let produit = 4 * 30; // division let quotient = 56.7 / 32.2; // modulo let reste = 43 % 5;
} Chaque expression de ces instructions utilise un opérateur mathématique et calcule une valeur unique, qui est ensuite attribuée à une variable. L'annexe B présente une liste de tous les opérateurs que Rust fournit. Le type booléen Comme dans la plupart des langages de programmation, un type booléen a deux valeurs possibles en Rust : true (vrai) et false (faux). Les booléens prennent un octet en mémoire. Le type booléen est désigné en utilisant bool. Par exemple : Fichier : src/main.rs fn main() { let t = true; let f: bool = false; // avec une annotation de type explicite
} Les valeurs booléennes sont principalement utilisées par les structures conditionnelles, comme l'expression if. Nous aborderons le fonctionnement de if en Rust dans la section “Les structures de contrôle” . Le type caractère Jusqu'à présent, nous avons utilisé uniquement des nombres, mais Rust peut aussi travailler avec des lettres. Le type char (comme character ) est le type de caractère le plus rudimentaire, et le code suivant va vous montrer une façon de l'utiliser. (A noter que les char sont écrits avec des guillemets simples, contrairement aux chaînes, qui utilisent des guillemets doubles.) Fichier : src/main.rs fn main() { let c = 'z'; let z = 'ℤ'; let chat_aux_yeux_de_coeur = '😻';
} Le type char de Rust prend quatre octets en mémoire et représente une valeur scalaire Unicode, ce qui veut dire que cela représente plus de caractères que l'ASCII. Les lettres accentuées ; les caractères chinois, japonais et coréens ; les emoji ; les espaces de largeur nulle ont tous une valeur pour char avec Rust. Les valeurs scalaires Unicode vont de U+0000 à U+D7FF et de U+E000 à U+10FFFF inclus. Cependant, le concept de “caractère” n'est pas clairement défini par Unicode, donc votre notion de “caractère” peut ne pas correspondre à ce qu'est un char en Rust. Nous aborderons ce sujet plus en détail au chapitre 8 .

