Les types composés peuvent regrouper plusieurs valeurs dans un seul type. Rust a deux types composés de base : les tuples et les tableaux (arrays) . Le type tuple Un tuple est une manière générale de regrouper plusieurs valeurs de types différents en un seul type composé. Les tuples ont une taille fixée : à partir du moment où ils ont été déclarés, on ne peut pas y ajouter ou enlever des valeurs. Nous créons un tuple en écrivant une liste séparée par des virgules entre des parenthèses. Chaque emplacement dans le tuple a un type, et les types de chacune des valeurs dans le tuple n'ont pas forcément besoin d'être les mêmes. Nous avons ajouté des annotations de type dans cet exemple, mais c'est optionnel : Fichier : src/main.rs fn main() { let tup: (i32, f64, u8) = (500, 6.4, 1);
} La variable tup est liée à tout le tuple, car un tuple est considéré comme étant un unique élément composé. Pour obtenir un élément précis de ce tuple, nous pouvons utiliser un filtrage par motif (pattern matching) pour déstructurer ce tuple, comme ceci : Fichier : src/main.rs fn main() { let tup = (500, 6.4, 1); let (x, y, z) = tup; println!("La valeur de y est : {}", y);
} Le programme commence par créer un tuple et il l'assigne à la variable tup. Il utilise ensuite un motif avec let pour prendre tup et le scinder en trois variables distinctes : x, y, et z. On appelle cela déstructurer , car il divise le tuple en trois parties. Puis finalement, le programme affiche la valeur de y, qui est 6.4. En plus de pouvoir déstructurer avec un filtrage par motif, nous pouvons accéder directement à chaque élément du tuple en utilisant un point (.) suivi de l'indice de la valeur que nous souhaitons obtenir. Par exemple : Fichier : src/main.rs fn main() { let x: (i32, f64, u8) = (500, 6.4, 1); let cinq_cents = x.0; let six_virgule_quatre = x.1; let un = x.2;
} Ce programme crée un tuple, x, puis crée une nouvelle variable pour chaque élément en utilisant leur indice. Comme dans de nombreux langages de programmation, le premier indice d'un tuple est 0. Le type tableau Un autre moyen d'avoir une collection de plusieurs valeurs est d'utiliser un tableau . Contrairement aux tuples, chaque élément d'un tableau doit être du même type. Les tableaux de Rust diffèrent de ceux de certains autres langages car les tableaux de Rust ont une taille fixe, comme les tuples. Avec Rust, les valeurs stockées dans un tableau sont écrites dans une liste séparée par des virgules entre des crochets : Fichier : src/main.rs fn main() { let a = [1, 2, 3, 4, 5];
} Les tableaux sont utiles quand vous voulez que vos données soient allouées sur la pile (stack) plutôt que sur le tas (heap) (nous expliquerons la pile et le tas au chapitre 4) ou lorsque vous voulez vous assurer que vous avez toujours un nombre fixe d'éléments. Cependant, un tableau n'est pas aussi flexible qu'un vecteur (vector) . Un vecteur est un type de collection de données similaire qui est fourni par la bibliothèque standard qui, lui, peut grandir ou rétrécir en taille. Si vous ne savez pas si vous devez utiliser un tableau ou un vecteur, vous devriez probablement utiliser un vecteur. Le chapitre 8 expliquera les vecteurs. Un exemple de cas où vous pourriez avoir recours à un tableau plutôt qu'à un vecteur est un programme qui nécessite de connaître les noms des mois de l'année. Il est très improbable qu'un tel programme ait besoin d'ajouter ou de supprimer des mois, donc vous pouvez utiliser un tableau car vous savez qu'il contiendra toujours 12 éléments : let mois = ["Janvier", "Février", "Mars", "Avril", "Mai", "Juin", "Juillet", "Août", "Septembre", "Octobre", "Novembre", "Décembre"]; Vous pouvez écrire le type d'un tableau en utilisant des crochets, et entre ces crochets y ajouter le type de chaque élément, un point-virgule, et ensuite le nombre d'éléments dans le tableau, comme ceci : let a: [i32; 5] = [1, 2, 3, 4, 5]; Ici, i32 est le type de chaque élément. Après le point-virgule, le nombre 5 indique que le tableau contient cinq éléments. L'écriture d'un type de tableau de cette manière ressemble à une autre syntaxe pour initialiser un tableau : si vous voulez créer un tableau qui contient la même valeur pour chaque élément, vous pouvez préciser la valeur initiale, suivie par un point-virgule, et ensuite la taille du tableau, le tout entre crochets, comme ci-dessous : let a = [3; 5]; Le tableau a va contenir 5 éléments qui auront tous la valeur initiale 3. C'est la même chose que d'écrire let a = [3, 3, 3, 3, 3]; mais de manière plus concise. Accéder aux éléments d'un tableau Un tableau est un simple bloc de mémoire alloué sur la pile. Vous pouvez accéder aux éléments d'un tableau en utilisant l'indexation, comme ceci : Fichier : src/main.rs fn main() { let a = [1, 2, 3, 4, 5]; let premier = a[0]; let second = a[1];
} Dans cet exemple, la variable qui s'appelle premier aura la valeur 1, car c'est la valeur à l'indice [0] dans le tableau. La variable second récupèrera la valeur 2 depuis l'indice [1] du tableau. Accès incorrect à un élément d'un tableau Que se passe-t-il quand vous essayez d'accéder à un élément d'un tableau qui se trouve après la fin du tableau ? Imaginons que vous changiez l'exemple par le code suivant, qui va compiler mais qui va quitter avec une erreur quand il sera exécuté : Fichier : src/main.rs fn main() { let a = [1, 2, 3, 4, 5]; let indice = 10; let element = a[indice]; println!("La valeur de l'élément est : {}", element);
} Exécuter ce code en utilisant cargo run va donner le résultat suivant : $ cargo run Compiling arrays v0.1.0 (file:///projects/arrays) Finished dev [unoptimized + debuginfo] target(s) in 0.31 secs Running `target/debug/arrays`
thread 'main' panicked at 'index out of bounds: the len is 5 but the index is 10', src/main.rs:5:19
note: Run with `RUST_BACKTRACE=1` for a backtrace. La compilation n'a pas produit d'erreur, mais le programme a rencontré une erreur à l'exécution et ne s'est pas terminé avec succès. Quand vous essayez d'accéder à un élément en utilisant l'indexation, Rust va vérifier que l'indice que vous avez demandé est plus petit que la taille du tableau. Si l'indice est supérieur ou égal à la taille du tableau, Rust va paniquer . C'est un premier exemple pratique des principes de sécurité de Rust. Dans de nombreux langages de bas niveau, ce genre de vérification n'est pas effectuée, et quand vous utilisez un indice incorrect, de la mémoire invalide peut être récupérée. Rust vous protège de ce genre d'erreur en quittant immédiatement l'exécution au lieu de permettre l'accès en mémoire et continuer son déroulement. Le chapitre 9 expliquera la gestion d'erreurs de Rust.
